import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

function General(props) {
    let { location, current } = props.weather;
    let {name} = location;
    let {temp_c, condition: {icon}} = current;

    return (    
        <Row>
            <Col>
                <Col>
                    <span>{name}</span>
                </Col>

                <Col>
                <span>{temp_c}</span>
                </Col>
            </Col>

            <Col>
                <img src={`${icon}`} />
            </Col>
        </Row>
    )
}

export default General;
